import React from "react";
import ReactDOM from "react-dom";
import css from "./style.css";
import Heading from "./component/Heading";
import Time from "./component/Time";
import Listing from "./component/Listing";
import Imports from "./component/Imports";
import * as cal from "./component/calculator";
import Card from "./component/Card";
import Contacts from "./component/Contacts";
import Pipo from "./component/Pipo.js";
import Avatar from "./component/Avatar";
import Person from "./component/Person";

function createHer(jane) {
  return (
    <Contacts
      key={jane.id}
      contact={jane.name}
      photo={jane.imgURL}
      tel={jane.phone}
      email={jane.email}
    />
  );
}

ReactDOM.render(
  <div>
    <Heading />
    <Time />
    <Listing />
    <Imports />
    <ul>
      <li>{cal.Add(1, 2)}</li>
      <li>{cal.Multiply(2, 3)}</li>
      <li>{cal.Subtract(7, 2)}</li>
      <li>{cal.Division(5, 2)}</li>
    </ul>
    <Card
      nem="Kendrick Lamar"
      about="i gat loyalty gat royalty inside my dna"
      pic="https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2F3%2F32%2FPulitzer2018-portraits-kendrick-lamar.jpg&imgrefurl=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FKendrick_Lamar&tbnid=suv2kE8mrVinBM&vet=12ahUKEwixw6_DhoT3AhWawYUKHb-mBdUQMygAegUIARDXAQ..i&docid=5IxeTANB_dJFUM&w=999&h=1765&q=kendrick%20lamar&ved=2ahUKEwixw6_DhoT3AhWawYUKHb-mBdUQMygAegUIARDXAQ"
    />
    <Card
      nem="Will Smith"
      about="I can slap the hell out of ya"
      pic="./img/food.jpg"
    />
    <Contacts
      contact={Pipo[0].name}
      photo={Pipo[0].imgURL}
      tel={Pipo[0].phone}
      email={Pipo[0].email}
    />
    <Contacts
      contact={Pipo[1].name}
      photo={Pipo[1].imgURL}
      tel={Pipo[1].phone}
      email={Pipo[1].email}
    />
    <Contacts
      contact={Pipo[2].name}
      photo={Pipo[2].imgURL}
      tel={Pipo[2].phone}
      email={Pipo[2].email}
    />
    <Person />
    <Avatar />
    {Pipo.map(createHer)};
  </div>,
  document.getElementById("root")
);
